2. **Find the Equations of Lines \(AE\) and \(CD\):**
   - Line \(AE\) passes through points \(A(0, 6)\) and \(E(4, 0)\). The slope of \(AE\) is \(\frac{0 - 6}{4 - 0} = -\frac{3}{2}\). The equation of the line is \(y = -\frac{3}{2}x + 6\).
