What is the degree measure of the smallest angle in triangle $PQS$? Please reason step by step, and put your final answer within \boxed{{}}. To solve the problem, we need to analyze the geometric configuration of the circles and the triangle. Here's a step-by-step approach:

1. **Understand the Configuration:**
   - Four circles of radius 1 are tangent to each other and to the sides of triangle \( \triangle ABC \).
   - The centers of the circles \( P, Q, R, \) and \( S \) form a smaller triangle \( \triangle PQS \).

2. **Determine the Coordinates:**
   - Let's place the circles in a coordinate system for simplicity. Assume \( R \) is at the origin \((0, 0)\), \( Q \) is at \((-2, 0)\), \( S \) is at \((2, 0)\), and \( P \) is at \((1, \sqrt{3})\).

3. **Calculate the Distances:**
   - The distance between \( P \) and \( Q \) is \( PQ = \sqrt{(1 - (-2))^2 + (\sqrt{3} - 0)^2} = \sqrt{3^2 + (\sqrt{3})^2} = \sqrt{9 + 3} = \sqrt{12} = 2\sqrt{3} \).
   - The distance between \( P \) and \( S \) is \( PS = \sqrt{(1 - 2)^2 + (\sqrt{3} - 0)^2} = \sqrt{(-1)^2 + (\sqrt{3})^2} = \sqrt{1 + 3} = \sqrt{4} = 2 \).
   - The distance between \( Q \) and \( S \) is \( QS = \sqrt{(-2 - 2)^2 + (0 - 0)^2} = \sqrt{(-4)^2} = \sqrt{16} = 4 \).

4. **Use the Law of Cosines to Find the Angles:**
   - For \( \angle PQS \):
     \[
     \cos(\angle PQS) = \frac{PQ^2 + QS^2 - PS^2}{2 \cdot PQ \cdot QS} = \frac{(2\sqrt{3})^2 + 4^2 - 2^2}{2 \cdot 2\sqrt{3} \cdot 4} = \frac{12 + 16 - 4}{16\sqrt{3}} = \frac{24}{16\sqrt{3}} = \frac{3}{2\sqrt{3}} = \frac{\sqrt{3}}{2}
     \]
     So, \( \angle PQS = \cos^{-1}\left(\frac{\sqrt{3}}{2}\right) = 30^\circ \).

   - For \( \angle PSQ \):
     \[
     \cos(\angle PSQ) = \frac{PS^2 + QS^2 - PQ^2}{2 \cdot PS \cdot QS} = \frac{2^2 + 4^2 - (2\sqrt{3})^2}{2 \cdot 2 \cdot 4} = \frac{4 + 16 - 12}{16} = \frac{8}{16} = \frac{1}{2}
     \]
     So, \( \angle PSQ = \cos^{-1}\left(\frac{1}{2}\right) = 60^\circ \).

   - For \( \angle QPS \):
     \[
     \cos(\angle QPS) = \frac{PQ^2 + PS^2 - QS^2}{2 \cdot PQ \cdot PS} = \frac{(2\sqrt{3})^2 + 2^2 - 4^2}{2 \cdot 2\sqrt{3} \cdot 2} = \frac{12 + 4 - 16}{8\sqrt{3}} = \frac{0}{8\sqrt{3}} = 0
     \]
     So, \( \angle QPS = \cos^{-1}(0) = 90^\circ \).

5. **Determine the Smallest Angle:**
   - The angles of triangle \( \triangle PQS \) are \( 30^\circ \), \( 60^\circ \), and \( 90^\circ \). The smallest angle is \( 30^\circ \).

So, the degree measure of the smallest angle in triangle \( \triangle PQS \) is \( \boxed{30} \).

