In the figure above, $OCD$ is a right triangle.  Let $Q$ be the point on line $CD$ such that $OQ$ is perpendicular to $CD$.  Let $r = OB$, so $A$ is $r$ units north of $O$ and $C$ is $r$ units west of $O$. Then the altitude $OQ$ has length $x=\frac{r}{\sqrt2}$, and the distance $AD$ is

\begin{eqnarray*}
AD&=&140-r+x-y\\
&=&140-r+\frac{r}{\sqrt 2}+y.
\end{eqnarray*}The distance $DP$ is $\frac{140}{2}$.  So the equation of the rope $DP$ in terms of $y$ is

\begin{eqnarray*}
y&=&\left(\Delta y\over\Delta x\right)x+\Delta y\\
&=&\left(\frac{130-y}{70-r+\frac{r}{\sqrt 2}}\right)\left(y+\frac{r}{\sqrt 2}\right)+130-y\\
&=&\left({\frac{130-y}{70-(\sqrt 2-1)r}}\right)\left(y+\frac{r}{\sqrt 2}\right)+130-y=0.
\end{eqnarray*}

We set $r=0$ and see that $y\approx150.49$.  If we solve for $y$ when $r=140$, we get $y\approx137.20$.

The amount of rope used if $C$ and $H$ are replaced by a single rope is

\begin{eqnarray*}
HC+HD&=150+130\\
&=280,
\end{eqnarray*}but if $C$ and $H$ are replaced by a single rope $HP$, where $P$ is on the line between $C$ and $D$, then the amount of rope used is approximately

\begin{eqnarray*}
HP&=\sqrt{r^2+y^2}\\
&=\sqrt{98000+137.20^2}\\
&\approx320.59,
\end{eqnarray*}the latter answer valid only for $r=140$.  Hence, the greatest amount of rope that can be saved is approximately

\begin{eqnarray*}
HC+HD-HP&=280-320.59\\
&\approx\boxed{40.59} .
\end{eqnarray*}

